import React from "react";
import { Routes, Route } from "react-router-dom";
import GlobalStyle from "./styles/global";
import Menu from "./components/meni";
import UserManagementPage from "./paginas/UserManagementPage";
import AutoresPage from "./paginas/AutoresPage";
import LivrosPage from "./paginas/LivrosPage";
import OutroPage from "./paginas/OutroPage";

const App = () => {
  return (
    <>
      <Menu />
      <Routes>
        <Route path="/" element={<UserManagementPage />} />
        <Route path="/autores" element={<AutoresPage />} />
        <Route path="/livros" element={<LivrosPage />} />
        <Route path="/outro" element={<OutroPage />} />
      </Routes>
      <GlobalStyle />
    </>
  );
};

export default App;
